import React from "react";
import homepageImage from './images/homepage1.png'; // Import the image

const HomePage = () => {
    return (
            <div className="container">
              <div className="leftDiv">
                <img
                  src="/components/images/homepage1.png"
                  alt="Placeholder"
                  className="image"
                />
              </div>
              <div className="rightDiv">
                <h1>Welcome to My Website</h1>
                <p>This is the text that will be on the left side of the homepage.</p>
              </div>
            </div>
          );
        
  };
  
const styles = {
  container: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    height: '100vh',
    padding: '20px',
  },
  leftDiv: {
    flex: 1,
    padding: '20px',
  },
  rightDiv: {
    flex: 1,
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
  },
  image: {
    maxWidth: '100%',
    height: 'auto',
  },
};

export default HomePage;
